bool search(int* nums, int numsSize, int target)
{
    int rc = -1;
    int start = 0;
    int end = numsSize - 1;
    rc = div_search(nums, target, start, end);
    return rc;
}

int div_search(int *nums, int target, int start, int end)
{
    int mid;

    if (start == end)
    {
        int i;
        for (i=start; i<=end; i++)
        {
            if (nums[i] == target)
            {
                return i;
            }
        }
    }

    if (start < end)
    {
        mid = (start + end) / 2;

        div_search(nums, target, start, mid);
        div_search(nums, target, mid+1, end);
        
        int i;
        for (i=start; i<=end; i++)
        {
            if (nums[i] == target)
            {
                return 1;
            }
        }
    }
    return 0;
}


