void print_array(int *nums, int start, int end)
{
    int i;

    printf("[ ");
    for (i=start; i<=end; i++)
    {
        printf("%d", nums[i]);
        if (i != end)
        {
            printf(", ");
        }
    }
    printf(" ]");
    printf("\n");
}

